import React from 'react'
import { Link } from 'react-router-dom'

function NavBar() {
    return (
        <ul>
            <li><Link to="/">Home</Link></li>
            <li><Link to="/contact">Dashboard</Link></li>
            <li><Link to="/signup">SignUp</Link></li>
        </ul>
    );
}

export default NavBar;
